import API from './API';

export const deleteTutorial = (tutorialId) => {
  API.deleteTutorial(tutorialId)
    .then(response => {
      console.log(response.data)
      fetchTutorials();
    })
    .catch(function (error) {
      console.log(error);
    })
};
